import React, { useEffect, useState } from 'react'
import NftCardComponent from './nftCards-component';
import myImage from "../images/IMG_4916.jpeg"

function NftCards() {

  // const [cardData, setCardData] = useState(null);

  // useEffect(() => {
  //   getGitHubUserWithFetch();
  // }, []);

  // const getGitHubUserWithFetch = async () => {
  //   const response = await fetch(gitHubUrl);
  //   const jsonData = await response.json();
  //   setCardData(jsonData);
  // };

  return (
    <div className="Nft__card">
      <div className="Nft__card-description">
        See below to see all previous competitions
      </div>
      <div className="Nft__card-component">
        <NftCardComponent title="Aerial Modeling"
          src={myImage}
          subTitle={"Dancing through the air"}
          buttonLabel={"Contact"}
          description="I have placed first in nationals, and a few other competitions."
          Href="https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/28275453226897231703465806819373230177588197227119855361972987721240576786433" />
        <NftCardComponent title="Adventure Modeling"
          src={myImage}
          subTitle={"Pushing photography boundaries"}
          buttonLabel={"Book Event"}
          description="Competed 10 times, and have placed first in nationals. "
          Href="https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/28275453226897231703465806819373230177588197227119855361972987719041553530881" />
        <NftCardComponent title="Print Modeling"
          src={myImage}
          subTitle={"A Printed Odyssey"}
          buttonLabel={"View Photos"}
          description="Competed 1 time"
          Href="https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/28275453226897231703465806819373230177588197227119855361972987723439600041985" />
        <NftCardComponent title="Nude PhotoShoots"
          src={myImage}
          subTitle={"Over 500 photos available."}
          buttonLabel={"Contact for access"}
          description="Over 500 photo's available."
          Href="https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/28275453226897231703465806819373230177588197227119855361972987720141065158657" />
        {/* <NftCardComponent title="Victor"
          src={myImage}
          subTitle={"First"}
          description="Performed 3 times"
          Href="https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/28275453226897231703465806819373230177588197227119855361972987722340088414209" />
        <NftCardComponent title="Nationals"
          src={myImage}
          subTitle={"Second"}
          description="Competed 1 time"
          Href="https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/28275453226897231703465806819373230177588197227119855361972987717942041903105" /> */}
      </div>
      <a href="https://www.instagram.com/zen_aerial" target="_blank" rel="noreferrer" className="btn2 btn2--green">Explore Photos</a>
    </div>
  );
}

export default NftCards;
